	// Write more your code here

	create() {
		this.editorCreate();
		this.collision_layer.setCollisionBetween(0, 100, true);
		this.overlap_layer.setCollisionBetween(0, 12, true);
		this.player.setInteractive();
		this.cursors = this.input.keyboard.createCursorKeys();
		this.wasd = this.input.keyboard.addKeys('W,S,A,D,SPACE');

		let camera = this.cameras.cameras[0];
		camera.width = window.innerWidth * this.game.scale.displayScale.x;
		camera.setBounds(16, 0, this.game.config.width, this.game.config.height*3);
		camera.startFollow(this.player, true, 1, 1, 0, 64);

		window.addEventListener('resize', ()=>{
			camera.width = window.innerWidth * this.game.scale.displayScale.x;
		});

		this.t_game = this.time.addEvent({
			delay: 1000, //ms
			callback: this.tickClock,
			callbackScope: this,
			loop: true,
			timeScale: 1,
			paused: false
		});

		this.elems = { //dom elements
			time: document.getElementById("time"),
			health: document.getElementById("health"),
			coins: document.getElementById("coins"),
			cheats: document.getElementById("cheats")
		};

		this.registry.events.on('changedata', (parent, key, value) => {
			//console.log("data changed: " + key);
			switch(key) {
				case "health": 
					this.elems.health.innerText = value;					
					this.t_damage = this.time.addEvent({
						delay: 500,
						repeat: 4,
						callback: this.allowDamage,
						callbackScope: this,
						paused: false
					});
					//todo: add sound effect
					break;
				case "coins": 
					this.elems.coins.innerText = value;
					//todo: add sound effect
					break;
				default: break;
			}
		});

		this.registry.set("time", 0);
		this.registry.set('health', 3);
		this.registry.set('coins', 0);
		this.registry.set('cheats', []);
		this.damaged = false; //track when player just took damage
		this.player_squatting = false;

		this.player_dx = 100; //player speed
		this.player_dy = 200; //jump/stomp speed
		this.player_gravity = 500;
		this.coin_value = 1;
		this.colours = {
			black: "#000000", grey: "#C1C1C1", 
			purple: "#A447F8", green: "#07A715"
		}

		this.elems.cheats.addEventListener("focus", (e) => {
			document.addEventListener('keydown', this.stopPropagation, true);	
			this.elems.cheats.value = "";	
		});
		this.elems.cheats.addEventListener("blur", (e) => {
			document.removeEventListener('keydown', this.stopPropagation, true);		
			this.elems.cheats.value = "S.E.C.R.E.T.S";		
		});
		this.elems.cheats.addEventListener('input', (e) => {
			this.cheats(e.target.value);
		});
		// blur the input when clicking outside of it 
		document.addEventListener('click', (e) => { 
			if (e.target !== this.elems.cheats) { this.elems.cheats.blur(); } 
		}); 
	}

	update(t, d) {
		//console.log("player xy: " + this.player.x + ", " + this.player.y);
		this.movePlayer();
	}

	// for typing in secret input
	stopPropagation(event) { 
		if (['W', 'A', 'S', 'D'].includes(event.key.toUpperCase())) { 
			event.stopPropagation(); 
		} 
	}

	// for game events, like taking damage
	enableKeyboardInput(enable) { 
		for(let key in this.cursors) {
			this.cursors[key].enabled = enable; 
			this.cursors[key].isDown = false; //it gets confused without this
		}
		for(let key in this.wasd) {
			this.wasd[key].enabled = enable; 
			this.wasd[key].isDown = false;
		}
	}

	tickClock() {
		let count = (999999999999 + 1 - this.t_game.getRepeatCount()); //bc it counts down
		this.registry.set("time", count);
		this.elems.time.innerText = count;
		//console.log("count: " + count);
	}

	collide(player, block) {
		if(block.index >= 0) {
			//console.log(block.index);
			const SHROOM = 29;

			if(player.body.blocked.up) {
				player.anims.play("bonk", true);
			}

			switch(block.index) {
				case SHROOM:
					if(this.player_squatting) {
						//console.log("launch");
						this.player.setVelocityY(-600);
					}
				break;
				default: break;
			}
		}
	}

	overlap(player, block) {
		if(block.index >= 0) {
			const STALAGMITES = 12;
			const STALACTITES = 6;
			const COINS = 13;
			//console.log("overlap block: " + block.index);
			switch(block.index) {
				case STALAGMITES:
					if(!this.damaged && (player.y >= block.bottom - 8)) {
						this.takeDamage();
					} 
				break;
				case STALACTITES:
					if(!this.damaged && (player.y < block.bottom - 6)) {
						this.takeDamage();
					}
				break;
				case COINS:
					this.overlap_layer.removeTileAt(block.x, block.y);
					this.registry.inc("coins", this.coin_value);
				break;
				default: break;
			}
		}
	}

	takeDamage() {
		this.damaged = true;
		this.enableKeyboardInput(false);
		this.player.setGravityY(0);
		this.player.setVelocityX(0);
		this.player.setVelocityY(0);
		this.elems.health.style.color = this.colours.purple;
		this.registry.inc('health', -1);
	}

	allowDamage() { //called after t_damage runs out
		let t = this.t_damage.getRepeatCount();
		//console.log(t);
		if(t === 4) {
			this.player.setGravityY(this.player_gravity);
			this.enableKeyboardInput(true);			
		} else if(t === 0) { 
			this.damaged = false;
			this.elems.health.style.color = this.colours.grey;
		}
	}

	heal(player, pot) {
		console.log("healing");
		pot.destroy();
		this.registry.inc('health', 1);
		this.elems.health.style.color = this.colours.green;
		let timer = this.time.addEvent({
			delay: 1000,
			repeat: 0,
			callback: () => this.elems.health.style.color = this.colours.grey,
			callbackScope: this,
			paused: false
		});
	}

	movePlayer() {
		let dir, jump, stomp, anim;
		this.player_squatting = false;

		if(this.cursors.left.isDown || this.wasd.A.isDown) {
            dir = 'left';
        } else if(this.cursors.right.isDown || this.wasd.D.isDown) {
            dir = 'right';
        }

        if(this.cursors.up.isDown || this.wasd.W.isDown || this.wasd.SPACE.isDown) {
            jump = true;
        } else if(this.cursors.down.isDown || this.wasd.S.isDown) {
            stomp = true;
        }

		if(jump) {
			anim = 'jump';
		} 

		if(dir === 'left') {
            this.player.setVelocityX(-this.player_dx); 
			anim = 'runLeft';
        } else if(dir === 'right') {
            this.player.setVelocityX(this.player_dx);
            anim = 'runRight';
        } else if(stomp) {
			this.player.setVelocityY(this.player_dy);
			this.player_squatting = true;
			anim = 'squat';
		} else if(!jump) {
			this.player.setVelocityX(0);
			anim = 'idle';
		}

		if(jump && this.player.body.blocked.down){
            if(Phaser.Input.Keyboard.JustDown(this.cursors.up) 
                || Phaser.Input.Keyboard.JustDown(this.wasd.W)
                || Phaser.Input.Keyboard.JustDown(this.wasd.SPACE)) {
                this.player.setVelocityY(-this.player_dy);
            } else {
				anim = 'idle'; //so jump anim does keep playing if holding key
			}
        }

		let key = this.player.anims.currentAnim?.key;
		if(key !== anim) { //check if anim is already playing
			//console.log(anim);
			if(this.player.anims.isPlaying && key === "bonk") {
				//do nothing
			} else {
				this.player.anims.play(anim, true);
			}
		}
	}

	warp0(player, obj) {
		this.warp(player, obj, this.hint_2.x, this.hint_2.y - 32);
	}
	warp1(player, obj) {
		this.warp(player, obj, this.hint_3.x, this.hint_3.y - 32);
	}
	warp2(player, obj) {
		this.warp(player, obj, this.hint_1.x, this.hint_1.y - 32);
	}
	warp3(player, obj) {
		this.warp(player, obj, this.hint_4.x, this.hint_4.y - 32);
	}
	warp4(player, obj) {
		this.warp(player, obj, this.hint_5.x, this.hint_5.y - 32);
	}

	warp(player, obj, x, y) {
		//console.log(player.x + ", " + obj.x)
		let left = obj.x - 4;
		let right = obj.x + 4;
		let p = player.x;
		if(!this.warping && (p > left) && (p < right)) {
			this.warping = true;
			this.enableKeyboardInput(false);
			let timer = this.time.addEvent({
				delay: 500,
				repeat: 0,
				callback: () => {
					this.player.setPosition(x, y);
					this.enableKeyboardInput(true);
					this.warping = false;
				},
				callbackScope: this,
				paused: false
			});
		}
	}

