	cheats(input) {
		input = input.toLowerCase();
		switch(input) {
			case "coins":
				//double coin value
				this.coin_value = 2;
				this.elems.coins.style.color = this.colours.green;
				break;
			case "health":
				//"infinite" health
				this.registry.set('health', 999);
				break;
			case "expose":
				//expose secrets
				break;
			case "antigrav":
				//reduce gravity
				if(!this.antigrav) {
					this.antigrav = true;
					this.player_gravity = 50;
					this.player.setGravityY(50);
				} else {
					this.antigrav = false;
					this.player_gravity = 500;
					this.player.setGravityY(500);
				}
				break;
			case "time":
				//clock ticks slower
				this.t_game.timeScale = 0.5;
				break;
			default: 
				return; //so input doesn't get blurred
		}
		this.elems.cheats.blur();
		let cheats = this.registry.get("cheats");
		if(!cheats.includes(input)) {
			cheats.push(input);
			console.log("cheats used: " + cheats);
			this.registry.set({"cheats": cheats});
		}
	}

